import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import axios from 'axios'; 
import { BASE_URL } from './App';

const TableContainer = styled.div`
    max-width: 1000px;
    margin: 0 auto;
    padding: 20px;
`;

const Table = styled.table`
    width: 100%;
    border-collapse: separate;
    border-spacing: 0;
    border: 1px solid #213B6B;
    border-radius: 8px;
    overflow: hidden;
    font-family: 'Hint Vadodara', sans-serif;
    font-size: 14px;
`;

const Th = styled.th`
    background-color: #213B6B;
    color: white;
    padding: 12px 15px;
    text-align: left;
`;

const Td = styled.td`
    background-color: rgba(33, 59, 107, 0.05);
    color: #333;
    padding: 12px 15px;
    border-bottom: 1px solid #ccc;
`;

const Tr = styled.tr`
    &:last-child td {
        border-bottom: none;
    }
`;

const ListarEmprendimientos = () => {
    const [emprendimientos, setEmprendimientos] = useState([]);

    useEffect(() => {
        // seccion de traida de datos de MongoDB
        /*
        const fetchEmprendimientos = async () => {
            try {
                const response = await axios.get('${BASE_URL}/emprendimientos');
                if (response.data && response.data.ok) {
                    setEmprendimientos(response.data.data);
                } else {
                    console.error('Error fetching data:', response.data.message);
                }
            } catch (error) {
                console.error('Error fetching data:', error);
            }
        };

        fetchEmprendimientos();
*/
        // comentar debajo de fetch y descomentar

        // data simulada
        const result = {
            "ok": true,
            "data": [
                {
                    "fecha": "2021/01/01",
                    "estado": "Idea",
                    "sector": {
                        "sector": "Tecnología",
                    },
                    "infoEmprendedor": {
                        "nombres": "persona1 apellido",
                        "apellidos": "persona1 apellido",
                    },
                    "IES": {
                        "nombre": "UNIVERSIDAD D'ANDORRA",
                    },
                    "pais": {
                        "descripcion": "ANDORRA",
                    }
                },
                {
                    "fecha": "2022/01/01",
                    "estado": "Crecimiento",
                    "sector": {
                        "sector": "Tecnología",
                    },
                    "infoEmprendedor": {
                        "nombres": "persona1 apellido",
                        "apellidos": "persona1 apellido",
                    },
                    "IES": {
                        "nombre": "UNIVERSIDAD D'ANDORRA",
                    },
                    "pais": {
                        "descripcion": "ANDORRA",
                    }
                },
                {
                    "fecha": "2023/12/01",
                    "estado": "Crecimiento",
                    "sector": {
                        "sector": "Tecnología",
                    },
                    "infoEmprendedor": {
                        "nombres": "persona1 apellido",
                        "apellidos": "persona1 apellido",
                    },
                    "IES": {
                        "nombre": "UNIVERSIDAD D'ANDORRA",
                    },
                    "pais": {
                        "descripcion": "ANDORRA",
                    }
                },
                {
                    "fecha": "2011/11/11",
                    "estado": "Crecimiento",
                    "sector": {
                        "sector": "Salud y Bienestar",
                    },
                    "infoEmprendedor": {
                        "nombres": "persona2 apellido",
                        "apellidos": "persona2 apellido",
                    },
                    "IES": {
                        "nombre": "UNIVERSITAT OBERTA DE LA SALLE",
                    },
                    "pais": {
                        "descripcion": "ANDORRA",
                    }
                },
                {
                    "fecha": "2012/12/12",
                    "estado": "Crecimiento",
                    "sector": {
                        "sector": "Salud y Bienestar",
                    },
                    "infoEmprendedor": {
                        "nombres": "persona2 apellido",
                        "apellidos": "persona2 apellido",
                    },
                    "IES": {
                        "nombre": "UNIVERSITAT OBERTA DE LA SALLE",
                    },
                    "pais": {
                        "descripcion": "ANDORRA",
                    }
                },
                {
                    "fecha": "2012/12/12",
                    "estado": "Lanzamiento Temprano",
                    "sector": {
                        "sector": "Salud y Bienestar",
                    },
                    "infoEmprendedor": {
                        "nombres": "persona3 apellido",
                        "apellidos": "persona3 apellido",
                    },
                    "IES": {
                        "nombre": "UNIVERSIDAD DE BUENOS AIRES",
                    },
                    "pais": {
                        "descripcion": "ARGENTINA",
                    }
                }
            ],
            "message": "Todo ok",
            "error": null
        };

        if (result.ok) {
            setEmprendimientos(result.data);
        } else {
            console.error('Error fetching data:', result.message);
        }
        //comentar aqui para eliminar simulado
    }, []);

    return (
        <TableContainer>
            <Table>
                <thead>
                    <tr>
                        <Th>Fecha</Th>
                        <Th>Estado</Th>
                        <Th>Sector</Th>
                        <Th>Emprendedor</Th>
                        <Th>IES</Th>
                        <Th>País</Th>
                    </tr>
                </thead>
                <tbody>
                    {emprendimientos.map((emprendimiento, index) => (
                        <Tr key={index}>
                            <Td>{emprendimiento.fecha}</Td>
                            <Td>{emprendimiento.estado}</Td>
                            <Td>{emprendimiento.sector.sector}</Td>
                            <Td>{`${emprendimiento.infoEmprendedor.nombres} ${emprendimiento.infoEmprendedor.apellidos}`}</Td>
                            <Td>{emprendimiento.IES.nombre}</Td>
                            <Td>{emprendimiento.pais.descripcion}</Td>
                        </Tr>
                    ))}
                </tbody>
            </Table>
        </TableContainer>
    );
};

export default ListarEmprendimientos;
